svg.script:
  var mouseDown = false;
  var adding = false;
  function makeDraggable(evt) {
  var svg = evt.target;
  svg.addEventListener('mousedown', startDrag);
  svg.addEventListener('mousemove', drag);
  svg.addEventListener('mouseup', endDrag);
  function startDrag(evt) {
	mouseDown = true;
	var svgobj=evt.target;
	if (svgobj.classList.contains("clicked"))
	{
		svgobj.classList.remove("clicked");
		adding = false;
	}
	else
	{
		svgobj.classList.add("clicked");
		adding = true;
	}
  }
  function drag(evt) {
	if (mouseDown) {
		var svgobj=evt.target;
		if (svgobj.classList.contains("clicked"))
		{
			if (!adding)
				svgobj.classList.remove("clicked");
			console.log("removed");
		}
		else
		{
			if (adding)
				svgobj.classList.add("clicked");
		}
	}
  }
  function endDrag(evt) {
	mouseDown = false;
  }
}
